	public static int lengthOfLongestSubstring(String s) {
		int maxLength = 1;// 初始长度置为 1 --- 非空字符串最大子串长度最少为 1
		
		if(s == null || s.isEmpty()) {
			maxLength = 0;// 只有字符串为空时最大子串长度才为 0
		} else {
			for (int i = 0; i< s.length(); i++) {
				for(int j = i + 1; j < s.length(); j++) {
					if(s.substring(i, j).contains(s.charAt(j) + "")) {// 如果存在重复字符就开始下一次便利
						break;
					}
					
					if(j - i + 1 > maxLength) { // 如果当前子串的长度更大就更新最大长度
						maxLength = j - i + 1;
					}
				}
			}
		}

		return maxLength;
	}
